body:
@hariharans29, Really thanks for investigating. And I agree that coordinate transformation should be skipped for any dimension which have 1.0 as scale or "input_size == output_size". Conduct coordinate map only if we really need a resize, and this is also consistent with pytorch implementation: [linear](https://github.com/pytorch/pytorch/blob/master/aten/src/ATen/native/cpu/UpSampleMoreKernel.cpp#L23), [nearest](https://github.com/pytorch/pytorch/blob/master/aten/src/ATen/native/cpu/UpSampleKernel.cpp#L42). Our model infer accuracy is correct when return output_index directly as input_index when scale is 1.0.
BTW, for resize with cubic mode, the [implementation only support bicubic](https://github.com/pytorch/pytorch/blob/master/aten/src/ATen/native/cpu/UpSampleKernel.cpp#L42) but have no check if input is 2D or 4D. This lead to incorrect result without any exception or warning. The[ same check](https://github.com/microsoft/onnxruntime/blob/master/onnxruntime/core/providers/cpu/tensor/upsample.cc#L644) is done for linear mode.

Regards!
